package com.platform.rp.services.sms.external.entity;

public class SmsResult {
	//{"StatusCode":1108,"Description":"错误的手机号码","MsgId":null,"Amount":0,"SuccessCounts":0,"Errors":null}

	private String statusCode;
	private String description;
	private String msgId;
	private String smount;
	private String successCounts;
	private String errors;
	public String getStatusCode() {
		return statusCode;
	}
	public void setStatusCode(String statusCode) {
		this.statusCode = statusCode;
	}
	public String getDescription() {
		return description;
	}
	public void setDescription(String description) {
		this.description = description;
	}
	public String getMsgId() {
		return msgId;
	}
	public void setMsgId(String msgId) {
		this.msgId = msgId;
	}
	public String getSmount() {
		return smount;
	}
	public void setSmount(String smount) {
		this.smount = smount;
	}
	public String getSuccessCounts() {
		return successCounts;
	}
	public void setSuccessCounts(String successCounts) {
		this.successCounts = successCounts;
	}
	public String getErrors() {
		return errors;
	}
	public void setErrors(String errors) {
		this.errors = errors;
	}
	
}
	
